// import { CarListsState } from "./CarListSlice";

const API_URL = "http://localhost:3000/api/v1/people";

export async function fetchCarLists() {
    return fetch(`${API_URL}/cars`, {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
        },
    }).then((res) => res.json())
    .catch((error) => {
        console.log("Error: ", error);
        return {};
    });
}
